import React from "react";
// import './sign.css';
class SignIn extends React.Component {
    constructor() {
        super();
    }
    render() {
        return (
            <div class="col-md-4 offset-md-4 con">
                {false?
                <div class="alert alert-danger" role="alert">
                </div>:
                <div></div>
    }
                <h1>Sign In</h1>
                <form action="signin" method="post">
                    <div class="mb-3">
                        <label for="email" class="form-label">Phone</label>
                        <input type="text" class="form-control" name="phone" minlength="11" maxlength="11" required/>
                    </div>
                    <div class="mb-3">
                        <label for="password" class="form-label">Password</label>
                        <input type="password" class="form-control" name="password" minlength="10" required/>
                    </div>
                    <button type="submit" class="btn btn-primary btn1">Sign In</button>
                </form>
            </div>
        )
    }
}
export default SignIn;
